import React from 'react'

import { Page, Item, ItemText } from './styles'
import lista from '../../assets/listaScrol'

export default function Lista() {
  return (
    <Page>
      {
        Lista.map((item) => {
          return (
            <Item>
              <ItemText>{item.task} </ItemText>
            </Item>
          )
        })
      }
    </Page>
  )
}
